import React from 'react'
import './NEOsArea.css'
import Card from '../Card/Card.js'

const NEOsArea = ({ NEOs }) => {
  console.log('NEOs: ', ObjectNEOs)
  let cards = []
  if (NEOs !== null) {
    cards = NEOs.map(object => {
      return (
        <Card object={object} />
      )
    })
  }

  return (
    <div className='object-area'>
      {cards}
    </div>
  )
}

export default NEOsArea
